import React from "react";
import {Grid, Text, Button, Image, Input} from "../elements";

const Table = (props) => {

    return (
        <React.Fragment>
            {/* <Table/> */}
            <Grid padding="16px">
                <Text margin="0px" size="24px" bold>
                등록된 자료들
                </Text>
                <table id="customers">
                    <tr>
                        <th>링크 혹은 이미지</th>
                        <th>내용 요약</th>
                    </tr>
                    <tr>
                        <td>1</td>
                        <td>2</td>
                        <td>3</td>
                    </tr>
                </table>
            </Grid>
        </React.Fragment>
    )
}

export default Table;
